import React from 'react';
import {Redirect, Route} from 'react-router-dom';

const PublicRoute = ({

  isAuthenticated, 
  component:Component, 
  ...rest
}) => {

  return (
    <Route {...rest}
      component={(props)=>(
        (isAuthenticated) &&
          <Redirect to='/'/>
      )}
    />
  )
}

export default PublicRoute;
